import React from 'react';

const SignedInLinks = () =>  {
    return ( 
         <ul className="right">
            <li><a href="#">New Project</a></li>
            <li><a href="#">Log out</a></li>
            <li><a href="#" className="btn btn-floating pink lighten-1">B</a></li>
        </ul>
    );
}
 
export default SignedInLinks;
